        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThis module provides compatibility instances and wrappers for the\n things that \u003ccode\u003ethyme\u003c/code\u003e does differently from \u003ccode\u003etime\u003c/code\u003e, and allows it to be\n used as a drop-in replacement for the latter, with the exceptions noted\n below:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e When constructing an \u003ccode\u003e\u003ca\u003eUTCTime\u003c/a\u003e\u003c/code\u003e or \u003ccode\u003e\u003ca\u003eUniversalTime\u003c/a\u003e\u003c/code\u003e, use \u003ccode\u003e\u003ca\u003emkUTCTime\u003c/a\u003e\u003c/code\u003e or\n   \u003ccode\u003e\u003ca\u003emkModJulianDate\u003c/a\u003e\u003c/code\u003e in place of \u003ccode\u003eUTCTime\u003c/code\u003e or \u003ccode\u003eModJulianDate\u003c/code\u003e.\n\u003c/li\u003e\u003cli\u003e Instead of pattern matching on \u003ccode\u003eUTCTime\u003c/code\u003e, use \u003ccode\u003e\u003ca\u003eunUTCTime\u003c/a\u003e\u003c/code\u003e to get\n   a \u003ccode\u003e\u003ca\u003eUTCView\u003c/a\u003e\u003c/code\u003e, which has a constructor \u003ccode\u003eUTCTime\u003c/code\u003e with the same fields.\n   For \u003ccode\u003eModJulianDate\u003c/code\u003e, use \u003ccode\u003e\u003ca\u003egetModJulianDate\u003c/a\u003e\u003c/code\u003e. \u003ccode\u003eViewPatterns\u003c/code\u003e may make\n   the transition more seamless.\n\u003c/li\u003e\u003cli\u003e Where a third party library uses \u003ccode\u003etime\u003c/code\u003e, you can use \u003ccode\u003e\u003ca\u003etoThyme\u003c/a\u003e\u003c/code\u003e and\n   \u003ccode\u003e\u003ca\u003efromThyme\u003c/a\u003e\u003c/code\u003e to convert between the corresponding types.\n\u003c/li\u003e\u003cli\u003e \u003ccode\u003e\u003ca\u003eYear\u003c/a\u003e\u003c/code\u003es are \u003ccode\u003e\u003ca\u003eInt\u003c/a\u003e\u003c/code\u003es, not \u003ccode\u003e\u003ca\u003eInteger\u003c/a\u003e\u003c/code\u003es: you may need \u003ccode\u003e\u003ca\u003efromIntegral\u003c/a\u003e\u003c/code\u003e.\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eYou shouldn't need to use \u003ccode\u003elens\u003c/code\u003e or \u003ccode\u003evector-space\u003c/code\u003e directly if you don't\n want to. However if you do use \u003ccode\u003evector-space\u003c/code\u003e and wish to avoid the\n \u003ccode\u003e\u003ca\u003eRealFrac\u003c/a\u003e\u003c/code\u003e instances for \u003ccode\u003e\u003ca\u003eDiffTime\u003c/a\u003e\u003c/code\u003e and \u003ccode\u003e\u003ca\u003eNominalDiffTime\u003c/a\u003e\u003c/code\u003e, import\n \u003ca\u003eData.Thyme.Time.Core\u003c/a\u003e instead.\n\u003c/p\u003e\u003cp\u003eAnything else is probably not intentional, and you should either contact\n me via IRC or file an issue at \u003ca\u003ehttps://github.com/liyang/thyme/issues\u003c/a\u003e.\n\u003c/p\u003e\u003c/div\u003e",
