        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThyme is a rewrite of the fine \u003ccode\u003etime\u003c/code\u003e library, with a particular focus\n on performance for applications that make heavy use of timestamps. For\n example, \u003ccode\u003e\u003ca\u003eUTCTime\u003c/a\u003e\u003c/code\u003e is represented with &#956;s precision as an \u003ccode\u003e\u003ca\u003eInt64\u003c/a\u003e\u003c/code\u003e, which gives a usable range from \u003ccode\u003e-290419-11-07\n 19:59:05.224192 UTC\u003c/code\u003e to \u003ccode\u003e294135-11-26 04:00:54.775807 UTC\u003c/code\u003e in the future.\n\u003c/p\u003e\u003cp\u003eConversions are provided as \u003ccode\u003e\u003ca\u003eIso'\u003c/a\u003e\u003c/code\u003es from the \u003ccode\u003elens\u003c/code\u003e\n package, while \u003ccode\u003e\u003ca\u003eAdditiveGroup\u003c/a\u003e\u003c/code\u003e,\n \u003ccode\u003e\u003ca\u003eVectorSpace\u003c/a\u003e\u003c/code\u003e and \u003ccode\u003e\u003ca\u003eAffineSpace\u003c/a\u003e\u003c/code\u003e from\n \u003ccode\u003evector-space\u003c/code\u003e allow for more principled calculations instead of \u003ccode\u003e\u003ca\u003eNum\u003c/a\u003e\u003c/code\u003e,\n \u003ccode\u003e\u003ca\u003eFractional\u003c/a\u003e\u003c/code\u003e & al. Check each module for usage examples, and see\n \u003ca\u003ehttp://hackage.haskell.org/package/lens\u003c/a\u003e or\n \u003ca\u003ehttp://hackage.haskell.org/package/vector-space\u003c/a\u003e for further details.\n\u003c/p\u003e\u003cp\u003eThyme uses strict and unpacked tuples throughout, e.g. \u003ccode\u003e\u003ca\u003eYearMonthDay\u003c/a\u003e\u003c/code\u003e or\n \u003ccode\u003e\u003ca\u003eWeekDate\u003c/a\u003e\u003c/code\u003e. Descriptive \u003ccode\u003e\u003ca\u003eInt\u003c/a\u003e\u003c/code\u003e synonyms such\n as \u003ccode\u003e\u003ca\u003eYear\u003c/a\u003e\u003c/code\u003e and \u003ccode\u003e\u003ca\u003eDayOfMonth\u003c/a\u003e\u003c/code\u003e are also provided.\n\u003c/p\u003e\u003cp\u003eOn platforms where \u003ccode\u003e\u003ca\u003eInt\u003c/a\u003e\u003c/code\u003e is 64-bits wide, types with an \u003ccode\u003e\u003ca\u003eEnum\u003c/a\u003e\u003c/code\u003e instance\n can be used as \u003ccode\u003e\u003ca\u003eKey\u003c/a\u003e\u003c/code\u003es for \u003ccode\u003e\u003ca\u003eIntMap\u003c/a\u003e\u003c/code\u003e, preferably\n via the \u003ccode\u003eEnumMap\u003c/code\u003e wrapper provided by\n \u003ca\u003ehttp://hackage.haskell.org/package/enummapset-th\u003c/a\u003e. In any case the \u003ccode\u003e\u003ca\u003eOrd\u003c/a\u003e\u003c/code\u003e\n instances are much faster, if you must use \u003ccode\u003e\u003ca\u003eMap\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003e\u003ca\u003eData.Thyme.Time\u003c/a\u003e is a drop-in compatibility module for existing code.\n\u003c/p\u003e\u003c/div\u003e",
